// 动态处理输入数据的n8n Code节点代码
try {
  // 获取输入字符串
  const inputStr = $input.first().json.answer;

  // 将提供的字符串转换为JSON对象
  let jsonData;

  if (typeof inputStr === 'string') {
    // 1. 移除外层多余的引号
    let cleanedStr = inputStr;
    if (cleanedStr.startsWith('"') && cleanedStr.endsWith('"')) {
      cleanedStr = cleanedStr.slice(1, -1);
    }

    // 2. 处理转义字符
    cleanedStr = cleanedStr
      .replace(/\\"/g, '"')     // 替换 \" 为 "
      .replace(/\\n\s*/g, '')   // 移除所有 \n 及其后面的空格
      .replace(/\\\\/g, '\\')   // 替换 \\ 为 \
      .replace(/\\t/g, '');     // 移除所有 \t

    // 3. 尝试解析为JSON
    try {
      jsonData = JSON.parse(cleanedStr);
    } catch (e) {
      throw new Error(`无法解析JSON字符串: ${e.message}`);
    }
  } else if (typeof inputStr === 'object' && inputStr !== null) {
    // 如果已经是对象，直接使用
    jsonData = inputStr;
  } else {
    throw new Error(`无效的输入类型: ${typeof inputStr}`);
  }

  // 确保jsonData为数组
  const jsonArray = Array.isArray(jsonData) ? jsonData : [jsonData];

  // 提取所有source的url
  const sourceUrls = [];

  // 检查输入中是否有sources字段，并提取所有url
  if ($input.first().json.sources && Array.isArray($input.first().json.sources)) {
    $input.first().json.sources.forEach(source => {
      if (source.url) {
        sourceUrls.push(source.url);
      }
    });
  }

  // 创建结果
  return [{
    json: {
      // 返回JSON对象数组
      items: jsonArray,
      // 返回提取的URL数组
      urls: sourceUrls,
      success: true
    }
  }];
} catch (error) {
  // 错误处理
  return [{
    json: {
      error: error.message,
      success: false
    }
  }];
}

// 提取字段值
const riskItem = $input.first().json.items[0].risk_item;
const relationshipType = $input.first().json.items[0].relationship_type;
const findingSummary = $input.first().json.items[0].finding_summary;
const sourceUrls = $input.first().json.urls || [];
const totalItems = $('Code').first().json.totalItems

// 创建基本输出字符串，使用\\n作为换行符
let formattedOutput = `Risk Item: ${riskItem}\\nRelationship Type: ${relationshipType}\\nFinding Summary: ${findingSummary}`;

// 创建一个单独的URL字符串
let urlsString = '';
if (sourceUrls.length > 0) {
  sourceUrls.forEach((url, index) => {
    urlsString += `${index + 1}. ${url}\\n`;
  });
  // 移除最后一个换行符
  if (urlsString.endsWith('\\n')) {
    urlsString = urlsString.slice(0, -2);
  }
}

// 返回格式化后的结果，包含result和单独的urls数组
return [{
  json: {
    result: formattedOutput,
    urls: urlsString,  // 将sourceUrls作为单独的字段输出
    totalItems : totalItems
  }
}];

// 假设上一个HTTP Request节点的输出中，文件内容的字符串存在于 $json.data
const jsonStringFromFile = $json.data;
const keywordslist = $('Code1').first().json.data;

try {
  // 清理尾随逗号 - 匹配 }, 后面跟着可能的空白字符和 ] 或 }
  const cleanedJsonString = jsonStringFromFile
    .replace(/,(\s*[\]}])/g, '$1'); // 移除 }, ] 或 }, } 中的逗号

  // 使用 JSON.parse() 将清理后的字符串转换为一个真正的JavaScript数组
  const parsedRiskList = JSON.parse(cleanedJsonString);

  // 合并 keywordslist 和 parsedRiskList
  const combinedList = [...keywordslist, ...parsedRiskList];

  // 统计 combinedList 中 Name 的数量
  const nameCount = combinedList.filter(item => 
    item && item.Name && item.Name.trim() !== ''
  ).length;

  // Code节点的输出应该是一个包含n8n item的数组。
  return [{
    json: {
      combinedData: combinedList,
      nameCount: nameCount,
      totalItems: combinedList.length
    }
  }];
} catch (error) {
  // 如果JSON字符串格式有问题，解析会失败，并在这里捕获错误。
  console.error("无法解析从GitHub文件获取的JSON字符串:", error.message);
  console.error("原始数据:", jsonStringFromFile); // 添加这行来调试
  // 最好将错误抛出，这样工作流会停止，并且您可以在n8n界面看到错误详情。
  throw error;
}

// Code here will run only once, no matter how many input items there are.
// More info and help: https://docs.n8n.io/nodes/n8n-nodes-base.function
// Tip: You can use luxon for dates and $jmespath for querying JSON structures
// 假设 $input.first().json.keywords 包含你要处理的字符串
const keywords = $input.first().json.keywords;
let keywordsList;
try { // Line 8 (counting from the start of this script block)
  // 首先检查 keywords 是否是一个有效的 JSON 数组字符串
  // 如果它本身就是 '["item1", "item2"]' 这种形式，JSON.parse 可以工作
  if (keywords && typeof keywords === 'string' && keywords.startsWith('[') && keywords.endsWith(']')) {
    keywordsList = JSON.parse(keywords);
  } else if (typeof keywords === 'string') {
    // 如果它是一个普通字符串，比如 "Military, National of defense"
    // 我们需要按逗号分割，并去除每个条目可能存在的多余空格
    // 同时处理空字符串的情况，以避免产生包含一个空字符串的数组
    if (keywords.trim() === '') {
      keywordsList = [];
    } else {
      keywordsList = keywords.split(',').map(item => item.trim());
    }
  } else if (keywords === null || keywords === undefined) {
    // 如果 keywords 是 null 或 undefined，视为空列表
    keywordsList = [];
  }
  else {
    // 如果输入不是字符串或者不是预期的格式，可以设置一个空数组或记录警告
    console.warn("输入数据 'keywords' 不是预期的字符串格式:", keywords);
    keywordsList = [];
    // 或者根据需要抛出错误:
    // throw new Error("输入数据 'keywords' 不是预期的字符串格式");
  }

  // 创建包含"Name"字段的对象数组
  const formattedKeywords = keywordsList.map(keyword => ({ "Name": keyword }));

  // 返回格式化后的结果
  return [{
    json: {
      data: formattedKeywords
    }
  }];
} catch (error) { // 添加了 catch 块
  // 如果在 try 块中的任何地方（例如 JSON.parse 或其他逻辑）发生错误
  console.error("处理 'keywords' 时出错:", error.message);
  // 最好将错误抛出，这样工作流会停止，并且您可以在n8n界面看到错误详情。
  // 你也可以选择返回一个表示错误的item
  // return [{ json: { error: error.message, originalKeywords: keywords } }];
  throw error;
}

const sourceObject = $('call_linkup_request').first().json.sources|| {}; // 或者是你的具体大对象字段名

// 直接转换整个对象为字符串（包含内部所有嵌套）
const sourceString = JSON.stringify(sourceObject);

return [
  {
    json: {
      source: sourceString
    }
  }
];

// 获取所有输入的数据项
const allItems = $input.all();
const totalProcessed = allItems.length;

// 创建完成通知
const doneMessage = {
  status: 'completed',
  message: `mission completed. ({totalProcessed} ) `,
  timestamp: new Date().toISOString(),
  totalItems: totalProcessed,
  processingTime: new Date().toLocaleString('zh-CN', {
    timeZone: 'Asia/Shanghai'
  }),
  summary: {
    batchSize: 1,
    totalBatches: totalProcessed,
    status: 'success'
  }
};

// 输出完成消息
return doneMessage;
